import React from 'react';
import FilterToggles from '../component/FilterToggles.js'
import { loadAllTraits } from '../actions/filter.js'
import { useSelector,useDispatch } from 'react-redux'


const FilterContainer = () => {


    const dispatch = useDispatch()

    const allTraits = useSelector(state => {
        return {allTraits: state.allTraits }
    })

    const fetchCategories = () => {
        fetch('http://localhost:3000/traits')
        .then(response => response.json())
        .then(data => {
        console.log('Success:', data);
        dispatch(loadAllTraits(data))
        })
        .catch((error) => {
        console.error('Error:', error);
        });
    }



return(
    <div className= "filter-container">
        {fetchCategories()}
        <h3> Category </h3>
        <FilterToggles/>
    </div>
)
}
export default FilterContainer
